import React, { useState } from "react";
import "./Products.css";
import { ShoppingCart, Bell } from "lucide-react";

const Products = () => {
  const [selectedCategory, setSelectedCategory] = useState("all");

  const categories = [
    { id: "all", name: "All Products", count: 200 },
    { id: "electronics", name: "Electronics", count: 35 },
    { id: "clothing", name: "Clothing", count: 28 },
    { id: "home", name: "Home & Garden", count: 22 },
    { id: "sports", name: "Sports & Fitness", count: 18 },
    { id: "beauty", name: "Beauty & Health", count: 17 },
  ];

  const productNames = [
    "Wireless Headphones", "Smart Watch", "Coffee Maker", "Messenger Bag",
    "Bluetooth Speaker", "Yoga Mat", "Knife Set", "Running Shoes",
    "Moisturizer", "Desk Lamp", "Charger", "Gaming Mouse", "T‑Shirt",
    "Protein Powder", "Oil Set"
  ];
  const categoryTypes = ["electronics","clothing","home","sports","beauty"];

  // Use unsplash or picsum placeholders as direct image URLs:
  // This uses `https://picsum.photos/seed/{seed}/300/300` to generate distinct images :contentReference[oaicite:1]{index=1}
  const generateProducts = () =>
    Array.from({ length: 200 }, (_, i) => {
      const category = categoryTypes[i % categoryTypes.length];
      const inStock = Math.random() > 0.1;
      const price = Math.floor(Math.random() * 300) + 20;
      const originalPrice = Math.random() > 0.5 ? price + Math.floor(Math.random()*100) : null;
      return {
        id: i + 1,
        name: `${productNames[i % productNames.length]} ${i + 1}`,
        price,
        originalPrice,
        rating: (Math.random() * 2 + 3).toFixed(1),
        reviews: Math.floor(Math.random() * 200) + 10,
        image: `https://picsum.photos/seed/product${i + 1}/300/300`,
        category,
        inStock,
      };
    });

  const allProducts = generateProducts();
  const filtered = allProducts.filter(p =>
    selectedCategory === "all" || p.category === selectedCategory
  );

  return (
    <div className="main-container">
      <aside className="sidebar">
        <h3>Categories</h3>
        {categories.map(cat => (
          <button
            key={cat.id}
            className={`sidebar-btn ${selectedCategory === cat.id ? "active" : ""}`}
            onClick={() => setSelectedCategory(cat.id)}
          >
            {cat.name}
            <span className="badge-count">{cat.count}</span>
          </button>
        ))}
      </aside>

      <div className="products-section">
        <div className="topbar">
          <h2>Showing {filtered.length} of 200 products</h2>
        </div>
        <div className="product-grid">
          {filtered.map(p => (
            <div key={p.id} className="product-card">
              <img src={p.image} alt={p.name} className="product-img" />
              <div className="product-details">
                <div className="rating">
                  {"★".repeat(Math.floor(p.rating))} <span>({p.reviews})</span>
                </div>
                <h4>{p.name}</h4>
                <div className="price-section">
                  <span className="price">${p.price}</span>
                  {p.originalPrice && (
                    <span className="original-price">${p.originalPrice}</span>
                  )}
                </div>
                <button
                  className={`action-btn ${p.inStock ? "" : "out-stock"}`}
                  disabled={!p.inStock}
                >
                  {p.inStock ? (
                    <>
                      <ShoppingCart size={16} /> Add to Cart
                    </>
                  ) : (
                    <>
                      <Bell size={16} /> Notify Me
                    </>
                  )}
                </button>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Products;
